				<div class="dash-card">
      <div id="stats-container">
      <h5 class="lg-nmbr">R${App.amountTaken}</h5>
	  <p>Parcela do emprestimo</p>
      </div>
    </div>
			</div>
		);
	}
}

export default ParcelasEmprestimo
